   "source": [
    "It is immediately clear from this visualization that all services were at a critical utilization level (100% utilization rate) for a large portion of the year. Of particular concern, emergency services were at a critical utilization level every week of the year.\n",
    "\n",
    "To further investigate factors that may lead to a high or critical utilization level in hospital services, we examine the relationship between utilization rate and the volume of patient requests."
