   "source": [
    "Patient request volume appears to be a driver of high and critical utilization rates across hospital services. For general medicine, ICU, and surgery services, there is a clear positive correlation between patient requests and utilization rate. Moreover, for all four hospital services, there is a threshold for patient requests beyond which utilization rate is consistently at maximum capacity.\n",
    "\n",
    "Another relevant variable to consider is bed availability, since this is not a constant and varies from week to week across hospital services."
   ]
