   "source": [
    "Across all hospital services, patient requests increase during flu epidemics and decrease during strikes. Accordingly, bed utilization is consistently higher during flu epidemics and lower during strikes. Of particular note, during all weeks in which there was a flu epidemic, utilization rate was 100% (critical).\n",
    "\n",
    "Flu epidemics are typically a seasonal occurrence. To examine this pattern, we create a timeseries plot to visualize the monthly prevalence of flu epidemics in the hospital."
   ]
