   "source": [
    "This visualization clearly shows that the prevalence of flu epidemics varied over the course of the year, with no epidemics between the months of May and November and highest prevalence in January.\n",
    "\n",
    "Having identified patient request volume as a potential driver of poor performance, we examine its relationship to a second key metric: the percent of patients refused service."
   ]
