   "source": [
    "This analysis reveals that patient request volume is a very strong predictor of the number of patients who are refused hospital services. The scatterplots show a clear positive trend. This is confirmed by the correlation coefficients, which indicate a strong linear correlation between patient requests and patients refused services across all hospital services.\n",
    "\n",
    "Overall, patient request volume is associated with performance across hospital services in two key metrics: bed utilization rate and patients refused services. Moreover, there is a clear association between flu epidemics and high patient request volume."
   ]
  },
